import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
// Material Components
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import Divider from '@material-ui/core/Divider';
import Avatar from '@material-ui/core/Avatar';
import NewReleasesIcon from '@material-ui/icons/NewReleases';
import SearchIcon from '@material-ui/icons/Search';

const styles = theme => ({
  root: {
    width: '100%',
    maxWidth: 360,
    backgroundColor: theme.palette.background.paper,
  },
});

function FolderList(props) {
  const { classes, prayerbead } = props;
  return (
    <List 
      className={classes.root}
      title={prayerbead.title}
      location={prayerbead.location}
      description={prayerbead.description}
      procurement={prayerbead.procurement}
    >
      <ListItem>
        <Avatar>
          {prayerbead.isRewarded ?
            <NewReleasesIcon /> 
            :
            <SearchIcon /> 
          }
        </Avatar>
        <ListItemText primary={prayerbead.title} secondary={prayerbead.description} />
      </ListItem>
      <Divider />
    </List>
  );
}

FolderList.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(FolderList);
